    },
    {
      fact: "Cats spend 70% of their lives sleeping.",
      petType: "Cats",
    },
    {
      fact: "Rabbits can jump as high as 3 feet in a single leap.",
      petType: "Rabbits",
    },
    {
      fact: "Goldfish can recognize their owners and get excited when they see them.",
